  padding: 5%;
}

.error404 .posts {
  margin-top: -24%;
}

.error404 .error {
  color: #7E8E71;
  font-weight: 700;
  text-transform: uppercase;
  text-align: center;
  font-size: 80px;
}

.error404 .contenedor404 {
  background-size: cover;
  height: 557px;
  overflow: hidden;
}

.irtienda {
  margin-left: 40px;
}

/*FIN DE LOS CAMBIOOS*/

.comment-list {
  padding-left: 0;
  list-style: none;
}

.comment-list ol {
  list-style: none;
}

/** Search form */

.search-form label {
  font-weight: normal;
}

.search-form .search-field {
  border-radius: 0 !important;
}

/**
 * WordPress Generated Classes
 * @see http://codex.wordpress.org/CSS#WordPress_Generated_Classes
 */

/** Media alignment */

.alignnone {
  margin-left: 0;
  margin-right: 0;
  max-width: 100%;
  height: auto;
}

.aligncenter {
  display: block;
  margin: 1rem auto;
  height: auto;
}

.alignleft,
.alignright {
  margin-bottom: 1rem;
  height: auto;
}

+ tablet .alignleft {
  float: left;
  margin-right: 1rem;
}

+ tablet .alignright {
  float: right;
  margin-left: 1rem;
}

/** Captions */

/** Text meant only for screen readers */

.screen-reader-text {
  position: absolute;
  width: 1px;
  height: 1px;
  padding: 0;
  margin: -1px;
  overflow: hidden;
  clip: rect(0, 0, 0, 0);
  border: 0;
  color: #000;
  background: #fff;
}

body#tinymce {
  margin: 12px !important;
}

