  // Colors
  @each $name, $pair in $colors {
    $color: nth($pair, 1);
    $color-invert: nth($pair, 2);
    &.is-#{$name} {
      background-color: $color;
      color: $color-invert;
      a:not(.button),
      strong {
        color: inherit; }
      .title {
        color: $color-invert; }
      .subtitle {
        color: rgba($color-invert, 0.9);
