    .hero-body {
      align-items: center;
      display: flex;
      & > .container {
        flex-grow: 1;
        flex-shrink: 1; } } }
  &.is-halfheight {
    min-height: 50vh; }
  &.is-fullheight {
    min-height: 100vh; } }

// Components

